troke: 'black', // 描边颜色 黑色\n      strokeWidth: 8 // 描边粗细 10px\n    })\n    return path;\n  },\n  // 导入图片\n  createImg(canvas) {\n    // 第一个参数是图片资源，可以放入本地图片，也可以放网络图片；\n    // 第二个参数是回调函数，图片加载完就可以对图片对象进行操作\n    // 第三个参数是通用属性设置\n    fabric.Image.fromURL(logo, oImg => {\n      oImg.scale(0.08) // 缩放\n      canvas.add(oImg) // 将图片加入到画布\n    }, {\n      top: -30,\n      left: 430,\n    })\n  },\n  // 创建一个不可操作的画布 只需把 new fabric.Canvas 改成 new fabric.StaticCanvas 即可\n  // 默认可拖拽\n  canvas = new fabric.Canvas('canvas-win', {\n    isDrawingMode: true, // 开启绘图模式\n  });\n  // 设置画笔颜色\n  canvas.freeDrawingBrush.color = '#11999e'\n  // 设置画笔粗细\n  canvas.freeDrawingBrush.width = 6\n  // 画笔投影\n  canvas.freeDrawingBrush.shadow = new fabric.Shadow({\n    blur: 10,\n    offsetX: 10,\n    offsetY: 10,\n    affectStroke: true,\n    color: '#30e3ca',\n  })\n  let rect = this.createRect();\n  let text = this.createText();\n  let path = this.createPath();\n  // 在canvas画布中加入矩形（rect）\n  // canvas.add(rect)\n  // 在canvas画布中加入绘制路径（path）\n  // canvas.add(path)\n  // canvas内创建图片\n  this.createImg(canvas);\n  // 建组，多个元素放一起\n  const group = new fabric.Group([rect, text], {\n    top: 30, // 整组距离顶部30\n    left: 30, // 整组距离左侧30\n    angle: -10, // 整组旋转-10deg\n  })\n  // 控制组第一个元素rect,切换颜色\n  group.item(0).set({fill: 'lightblue'})\n  canvas.add(group)\n  // 序列号\n  console.log('canvas stringify ', JSON.stringify(canvas))\n  console.log('canvas toJSON', canvas.toJSON())\n  console.log('canvas toObject', canvas.toObject())\n  // 在控制台输出 png（base64）。这个操作可能会打断 canvas 的渲染，所以之后要再执行以下 canvas.requestRenderAll() 。\n  console.log('toPng', canvas.toDataURL('png'))\n  canvas.requestRenderAll()\n  console.log(canvas.toSVG()) // 输出 SVG\n  // 反序列化，入参json\n  // canvas.loadFromJSON(canvas.toJSON())\n  ```\n  **图形常用样式**\n  ```\n  top: 100, // 距离容器顶部距离\n  left: 100, // 距离容器左侧距离\n  radius: 50, // 半径：50px\n  backgroundColor: 'green', // 背景色：绿色\n  fill: 'orange', // 填充色：橙色\n  stroke: '#f6416c', // 边框颜色：粉色\n  strokeWidth: 5, // 边框粗细：5px\n  strokeDashArray: [20, 5, 14], // 边框虚线规则：填充20px 空5px 填充14px 空20px 填充5px ……\n  shadow: '10px 20px 6px rgba(10, 20, 30, 0.4)', // 投影：向右偏移10px，向下偏移20px，羽化6px，投影颜色及透明度\n  transparentCorners: false, // 选中时，角是被填充了。true 空心；false 实心\n  borderColor: '#16f1fc', // 选中时，边框颜色：天蓝\n  borderScaleFactor: 5, // 选中时，边的粗细：5px\n  borderDashArray: [20, 5, 10, 7], // 选中时，虚线边的规则\n  cornerColor: \"#a1de93\", // 选中时，角的颜色是 青色\n  cornerStrokeColor: 'pink', // 选中时，角的边框的颜色是 粉色\n  cornerStyle: 'circle', // 选中时，叫的属性。默认rect 矩形；circle 圆形\n  cornerSize: 20, // 选中时，角的大小为20\n  cornerDashArray: [10, 2, 6], // 选中时，虚线角的规则\n  selectionBackgroundColor: '#7f1300', // 选中时，选框的背景色：朱红\n  padding: 40, // 选中时，选择框离元素的内边距：40px\n  borderOpacityWhenMoving: 0.6, // 当对象活动和移动时，对象控制边界的不透明度\n  angle: 30 // 旋转30度\n  scaleX: 2, // x轴方向放大2倍；scale是负数时，图形会反转\n  scaleY: 2 // y轴方向放大2倍；scale是负数时，图形会反转\n  ```\n   **文字常用样式**\n  ```\n  top: 40,\n  left: 40,\n  fontSize: 120,\n  backgroundColor: 'green', // 背景色：绿色\n  fill: 'orange', // 填充色：橙色\n  stroke: '#f6416c', // 边框颜色：粉色\n  strokeWidth: 3, // 边框粗细：3px\n  strokeDashArray: [20, 5, 14], // 边框虚线规则：填充20px 空5px 填充14px 空20px 填充5px ……\n  shadow: '10px 20px 6px rgba(10, 20, 30, 0.4)', // 投影：向右偏移10px，向下偏移20px，羽化6px，投影颜色及透明度\n  transparentCorners: false, // 选中时，角是被填充了。true 空心；false 实心\n  borderColor: '#16f1fc', // 选中时，边框颜色：天蓝\n  borderScaleFactor: 5, // 选中时，边的粗细：5px\n  borderDashArray: [20, 5, 10, 7], // 选中时，虚线边的规则\n  cornerColor: \"#a1de93\", // 选中时，角的颜色是 青色\n  cornerStrokeColor: 'pink', // 选中时，角的边框的颜色是 粉色\n  cornerStyle: 'circle', // 选中时，叫的属性。默认rect 矩形；circle 圆形\n  cornerSize: 20, // 选中时，角的大小为20\n  cornerDashArray: [10, 2, 6], // 选中时，虚线角的规则\n  selectionBackgroundColor: '#7f1300', // 选中时，选框的背景色：朱红\n  padding: 40, // 选中时，选择框离元素的内边距：40px\n  borderOpacityWhenMoving: 0.6, // 当对象活动和移动时，对象控制边界的不透明度\n  ```\n   **组常用方法**\n  ```\n  getObjects() 返回一组中所有对象的数组\n  size() 所有对象的数量\n  contains() 检查特定对象是否在 group 中\n  item() 组中元素\n  forEachObject() 遍历组中对象\n  add() 添加元素对象\n  remove() 删除元素对象\n  fabric.util.object.clone() 克隆\n  ```\n  [参考文章传送门](https://juejin.cn/post/7026941253845516324#heading-99)\n  "}},methods:{removeClickEvent:function(){h.off("mouse:down"),h.off("mouse:move")},addClickEvent:function(){this.removeClickEvent(),h.on("mouse:down",(function(t){console.log("x轴坐标: ".concat(t.e.clientX,";    y轴坐标: ").concat(t.e.clientY))}))},addMoveEvent:function(){this.removeClickEvent(),h.on("mouse:move",(function(t){console.log("x轴坐标: ".concat(t.e.clientX,";    y轴坐标: ").concat(t.e.clientY))}))},createRect:function(){var t=new s["fabric"].Rect({top:30,left:30,width:100,height:60,fill:"#4e6beb"});return t},createText:function(){var t=new s["fabric"].Text("这是长方形",{top:50,left:80,fontSize:14,originX:"center",originY:"center",fill:"#efefef"});return t},createPath:function(){var t=new s["fabric"].Path("M 0 110 L 60 60 L 200 60 z");return t.set({top:30,left:160,fill:"#4e6beb",opacity:.9,stroke:"black",strokeWidth:8}),t},createImg:function(t){s["fabric"].Image.fromURL(a.a,(function(e){e.scale(.08),t.add(e)}),{top:-30,left:430})}},mounted:function(){h=new s["fabric"].Canvas("canvas-win",{isDrawingMode:!0}),h.freeDrawingBrush.color="#11999e",h.freeDrawingBrush.width=6,h.freeDrawingBrush.shadow=new s["fabric"].Shadow({blur:10,offsetX:10,offsetY:10,affectStroke:!0,color:"#30e3ca"});var t=this.createRect(),e=this.createText(),i=this.createPath();h.add(i);var n=new s["fabric"].Group([t,e],{top:30,left:30,angle:-10});n.item(0).set({fill:"lightblue"}),h.add(n),this.createImg(h),console.log("toPng",h.toDataURL("png")),h.requestRenderAll()}},l=c,u=(i("700a"),i("2877")),f=Object(u["a"])(l,n,r,!1,null,"781c888c",null);e["default"]=f.exports},"700a":function(t,e,i){"use strict";i("84d2")},"7a94":function(t,e,i){(function(t){
